p_email:
let procedure p_email(v_email :String) := {
  now => @com.google.puppeteer(id="com.google.puppeteer").load(url="http://localhost:3000/"^^tt:url);
  now => @com.google.puppeteer(id="com.google.puppeteer").set_input(text="bob@gmail.com", frame_url="http://localhost:3000/"^^tt:url, selector="body > input:nth-child(24)");
  now => @com.google.puppeteer(id="com.google.puppeteer").set_input(text=v_email, frame_url="http://localhost:3000/"^^tt:url, selector="body > input:nth-child(24)");
  now => @com.google.puppeteer(id="com.google.puppeteer").set_input(text="Hello this is Joe", frame_url="http://localhost:3000/"^^tt:url, selector="body > textarea");
  now => @com.google.puppeteer(id="com.google.puppeteer").click(frame_url="http://localhost:3000/"^^tt:url, selector="body > #send");
} ;
